INSERT INTO `articles` VALUES (1, 'Մեր մասին', 'О нас', 'About Us', 'about-us', '<p>Wine is about so much more than just a great label; it&rsquo;s about an experience and community and, of course, what&rsquo;s in the bottle. That&rsquo;s where The House comes in. As the world&rsquo;s largest online wine marketplace and most downloaded wine app, the House community is made up of millions of wine drinkers from around the world, coming together to make buying the right wine simple, straightforward, and fun. The House uses crowd-sourced data to personalize wine recommendations so that every community member feels confident about their wine choices.</p>\r\n<p>&nbsp;</p>\r\n<p>The House is more than a store. It is a place of Character and Taste where each visitor will feel like a precious guest. We are here to reveal the world of Fine Wines, Premium Spirits and Gourmet Food and passionately tell the stories of legendary brands from around the world. The House is intended to be a hub for Taste Discovery, Guiding and Advisingon fine food &amp; drinks pairing.</p>', '<p>Wine is about so much more than just a great label; it&rsquo;s about an experience and community and, of course, what&rsquo;s in the bottle. That&rsquo;s where The House comes in. As the world&rsquo;s largest online wine marketplace and most downloaded wine app, the House community is made up of millions of wine drinkers from around the world, coming together to make buying the right wine simple, straightforward, and fun. The House uses crowd-sourced data to personalize wine recommendations so that every community member feels confident about their wine choices.</p>\r\n<p>&nbsp;</p>\r\n<p>The House is more than a store. It is a place of Character and Taste where each visitor will feel like a precious guest. We are here to reveal the world of Fine Wines, Premium Spirits and Gourmet Food and passionately tell the stories of legendary brands from around the world. The House is intended to be a hub for Taste Discovery, Guiding and Advisingon fine food &amp; drinks pairing.</p>', '<p>Wine is about so much more than just a great label; it&rsquo;s about an experience and community and, of course, what&rsquo;s in the bottle. That&rsquo;s where The House comes in. As the world&rsquo;s largest online wine marketplace and most downloaded wine app, the House community is made up of millions of wine drinkers from around the world, coming together to make buying the right wine simple, straightforward, and fun. The House uses crowd-sourced data to personalize wine recommendations so that every community member feels confident about their wine choices.</p>\r\n<p>&nbsp;</p>\r\n<p>The House is more than a store. It is a place of Character and Taste where each visitor will feel like a precious guest. We are here to reveal the world of Fine Wines, Premium Spirits and Gourmet Food and passionately tell the stories of legendary brands from around the world. The House is intended to be a hub for Taste Discovery, Guiding and Advisingon fine food &amp; drinks pairing.</p>', NULL, NULL);
INSERT INTO `articles` VALUES (2, 'Ընդհանուր դրույթներ և պայմաններ', 'Ընդհանուր դրույթներ և պայմաններ', 'Ընդհանուր դրույթներ և պայմաններ', 'terms-conditions', '<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Ներածություն</div>\r\n<div class=\"section_text\">\r\n<p>1.Սույն Ընդհանուր դրույթները և պայմանները &laquo;Դը Հաուս&raquo; ՍՊԸ կողմից մշակվել են հիմք ընդունելով ՀՀ քաղաքացիական օրենսգիրքը, &laquo;Առևտրի և ծառայությունների մասին&raquo; ՀՀ օրենքը, &laquo;Սպառողների իրավունքների պաշտպանությա մասին&raquo; ՀՀ օրենքը և այլ իրավական ակտեր։</p>\r\n<p>2.Սույն Ընդհանուր դրույթների և պայմանների նպատակն է կարգավորել &laquo;Դը Հաուս&raquo; ՍՊԸ և Հաճախորդների միջև առաջացող հարաբերություները՝ Կայք մուտք գործելիս և/կամ Կայքից որևէ ձևով օգտվելիս, ինչպես նաև, սակայն չսահմանափակվելով՝ Պատասխանատվության, Մտավոր սեփականության հետ առնչվող հարցերը։</p>\r\n<p>3.Սույն Ընդհանուր դրույթներն ու պայմանների անբաժանելի մասն են հանդիսանում Գաղտնիության քաղաքականությունը և Վերադարձի պայմանները։</p>\r\n<p>4.Հաճախորդների հետ կապված տեղեկատվությունը &laquo;Դը Հաուս&raquo; ՍՊԸ կողմից մշակվում է Գաղտնիության քաղաքականության համաձայն։</p>\r\n<p>5.Հաճախորդների հետ հարաբերությունները գնված ապրանքի ետ վերադարձման կամ փոխանակման կապացությամբ կարգավորվում են Վերադարձի պայմաններով։</p>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle m-b-16\">Սահմանումներ և հապավումներ</div>\r\n<div class=\"section_text\">\r\n<p class=\"m-0\">1. Սույն Ընդհանուր դրույթների և պայմանների իմաստով օգտագործվում են հետևյալ սահմանումները և հապավումները՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div class=\"mb-0\">\r\n<p>6.1. &laquo;Կայք&raquo;՝ thehouse.am,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.2. &laquo;Ընկերություն&raquo; ՝ &laquo;Դը Հաուս&raquo; ՍՊԸ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.3. &laquo;Հաճախորդ&raquo; ՝ Կայք մուտք գործած և/կամ Կայքից որևէ ձևով օգտվող ցանկացած ֆիզիկական անձ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.4. &laquo;Պայմաններ&raquo; ՝ սույն Ընդհանուր դրույթները և պայմանները։</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Ընկերություն և հաճախորդ հարաբերություններ</div>\r\n<div class=\"section_text\">\r\n<p>1.Հաճախորդը, մուտք գործելով Կայք և/կամ որևէ կերպ օգտվելով Կայքից, տալիս է իր համաձայնությունը սույն Պայմանների, Գաղտնիության քաղաքականության և Վերադարձի պայմանների բոլոր դրույթներին։</p>\r\n<p>2.Հաճախորդի կողմից սույն Պայմանների, Գաղտնիության քաղաքականության և/կամ Վերադարձի պայմանների դրույթների հետ անհամաձայնության դեպքում Ընկերությունը հորդորում է չօգտվել Կայքից և լքել այն։</p>\r\n<p>3.Կայքի հասանելիությունը և օգտագործումը իրականացվում է Հաճախորդի սեփական ռիսկով։</p>\r\n<p>4.Կայք մուտք գործելիս Հաճախորդը պետք է հաստատի, որ հասել է ալկոհոլի օգտագործման համար ՀՀ օրենսդրությամբ սահմանված տարիքին։ Եթե Կայք մուտք գործած անձի տարիքը չի համապատասխանում ՀՀ օրենսդրությամբ սահմանված տարիքին, ապա Ընկերությունը հորդորում է լքել Կայքը։ Ընկերությունը որևէ պատասխանատվություն չի կրում նման տարիքի չհասած անձանց կողմից Կայք մուտք գործելու, իր տարիքի վերաբերյալ կեղծ տեղեկություններ հայտնելու հետևանքով առաջացած վնասների համար։</p>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Հաճախորդի վարքագիծը կայքից օգտվելիս</div>\r\n<div class=\"section_text\">\r\n<p>1. Ընկերությունը խրախուսում է վիրտուալ տիրույթում բարիդրացիական հարաբերությունների, միմյանց նկատմամբ հարգալից վերաբերմունքի մշակույթի ձևավորումը։</p>\r\n<p class=\"m-0\">2. Կայքից օգտվելիս Հաճախորդը իրավունք չունի բեռնել, տեղադրել, փոխանցել, տարածել կամ այլ եղանակներով Կայքում հրապարակել նյութեր, որոնք՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>12.1. Ապօրինի են, զրպարտիչ, վիրավորական, սպառնացող, որևէ խտրականություն պարունակող, կոպիտ, անպարկեշտ, կեղծ, պարունակում են անհարգալից բառապաշար, ֆիզիկական և/կամ հոգեկան բռնություն կիրառելու կամ դրա սպառնալիքի գրավոր կամ գրաֆիկական նկարագրություններ և ակնարկ դրա մասին, ներխուժում են այլ անձի մասնավոր կյանք կամ քարոզում են ատելություն, ինչպես նաև ՀՀ Սահմանադրությամբ և օրենքներով արգելված այլ գործողությունների կատարման նկարագրություն, դրա սպառնալիք և այլն,</p>\r\n</div>\r\n<div>\r\n<p>12.2. Իրենց բնույթով և/կամ բովանդակությամբ ՀՀ քրեական օրենսգրքով պատժելի արարք են կամ դրա խրախուսման կոչեր են, և/կամ կարող են հանգեցնել ՀՀ օրենսդրությամբ նախատեսված վարչական կամ քաղաքացիական պատասխանատվության,</p>\r\n</div>\r\n<div>\r\n<p>12.3. Խանգարում կամ խոչընդոտում են այլ Հաճախորդներին օգտվել Կայքից, այդ թվում՝ եթե դրա վերաբերյալ Ընկերությունը ստացել է գրավոր կամ բանավոր բողոք,</p>\r\n</div>\r\n<div>\r\n<p>12.4. Պարունակում են կիբեր-անվտանգությունը խարխլող վիրուսներ և/կամ այլ վնասակար բաղադրիչներ, ցանկացած տեսակի գովազդ, ինչպես նաև կեղծ կամ մոլորեցնեող ցուցումներ փաստերի ծագման կամ հաստատման վերաբերյալ:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>3. Այս կապակցությամբ Ընկերությունը իրեն իրավունք է վերապահում ջնջել ցանկացած տիպի մեկնաբանություն, գրառում, չպատասխանել հարցումներին, բողոքներին և դիմումներին, որոնք իրենց մեջ պարունակում են սույն Պայմանների 12-րդ կետով սահմանված դեպքերից և որևէ մեկը։</p>\r\n<p>4. ՀՀ օրենսդրությամբ սահմանված դեպքերում Ընկերությունն իրեն իրավունք է վերապահում դիմել իրավապահ մարմիններին։</p>\r\n<p class=\"m-0\">5. Հաճախորդը նախազգուշացվում և համաձայնվում է, որ՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>15.1. Իր կողմից տրամադրված անձնական տվյալները վերաբերում են միմիայն իրեն․ Հաճախորդն իրավունք չունի իրեն անձնավորել մեկ այլ ֆիզիկական կամ իրավաբանական անձի հետ, և/կամ տրամադրել այդ անձանց հետ ունեցած կապերի, դրանց բնույթի և բովանդակության վերաբերյալ կեղծ տեղեկություններ,</p>\r\n</div>\r\n<div>\r\n<p>15.2. բեռնել, հրապարակել, տեղադրել, վերարտադրել, փոխանցել, տարածել կամ ցանկացած այլ եղանակով օգտագործել Կայքից ստացված տեղեկատվություն կամ այլ նյութեր, որևէ նպատակներով, բացառությամբ սույն Պայմանների 24-րդ կետով սահմանված դեպքերի,</p>\r\n</div>\r\n<div>\r\n<p>15.3. որևէ գործողությամբ փորձել ստանալ անօրինական մուտք այլ համակարգչային համակարգերի նկատմամբ Կայքի միջոցով:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>6. Արգելվում է Կայքը ենթարկել կիբեր-գրոհների կամ որևէ գործողությամբ խաթարել Կայքի կիբեր-անվտանգությունը: Արգելվում է Կայքն օգտագործել ոչ նպատակային կերպով՝ դիտավորությամբ տեղադրելով վիրուսներ և/կամ ցանկացած այլ տիպաբանության վնասաբեր ծրագրեր կամ տեխնոլոգիապես վտանգավոր բնույթի նյութեր։</p>\r\n<p>7. Արգելվում է ապօրինի մուտք գործել Կայք, Կայքի սերվեր, որտեղ տեղակայված է Կայքը, և/կամ ցանկացած այլ սերվեր, համակարգիչ և/կամ տվյալների բազա(ներ), որոնք որևէ կերպ կապված են Կայքի հետ։ Ընկերությունը պատասխանատվություն չի կրում կիբեր-գրոհներով, վիրուսներով և/կամ ցանկացած այլ տիպաբանության վնասաբեր ծրագրերով և/կամ տեխնոլոգիապես վտանգավոր բնույթի նյութերով պատճառված վնասի համար, որոնք կարող են վնասել որևէ համակարգչային սարքավորում, ծրագրային ապահովում, տվյալներ, տվյալների բազա(ներ) կամ Կայքի օգտագործման հետևանքով Հաճախորդի կողմից որևէ նյութի բեռնման հետևանքով կամ դրանում նշված հղումով անցնելու դեպքում պատճառված վնասի համար։</p>\r\n</div>\r\n</div>', '<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Ներածություն</div>\r\n<div class=\"section_text\">\r\n<p>1.Սույն Ընդհանուր դրույթները և պայմանները &laquo;Դը Հաուս&raquo; ՍՊԸ կողմից մշակվել են հիմք ընդունելով ՀՀ քաղաքացիական օրենսգիրքը, &laquo;Առևտրի և ծառայությունների մասին&raquo; ՀՀ օրենքը, &laquo;Սպառողների իրավունքների պաշտպանությա մասին&raquo; ՀՀ օրենքը և այլ իրավական ակտեր։</p>\r\n<p>2.Սույն Ընդհանուր դրույթների և պայմանների նպատակն է կարգավորել &laquo;Դը Հաուս&raquo; ՍՊԸ և Հաճախորդների միջև առաջացող հարաբերություները՝ Կայք մուտք գործելիս և/կամ Կայքից որևէ ձևով օգտվելիս, ինչպես նաև, սակայն չսահմանափակվելով՝ Պատասխանատվության, Մտավոր սեփականության հետ առնչվող հարցերը։</p>\r\n<p>3.Սույն Ընդհանուր դրույթներն ու պայմանների անբաժանելի մասն են հանդիսանում Գաղտնիության քաղաքականությունը և Վերադարձի պայմանները։</p>\r\n<p>4.Հաճախորդների հետ կապված տեղեկատվությունը &laquo;Դը Հաուս&raquo; ՍՊԸ կողմից մշակվում է Գաղտնիության քաղաքականության համաձայն։</p>\r\n<p>5.Հաճախորդների հետ հարաբերությունները գնված ապրանքի ետ վերադարձման կամ փոխանակման կապացությամբ կարգավորվում են Վերադարձի պայմաններով։</p>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle m-b-16\">Սահմանումներ և հապավումներ</div>\r\n<div class=\"section_text\">\r\n<p class=\"m-0\">1. Սույն Ընդհանուր դրույթների և պայմանների իմաստով օգտագործվում են հետևյալ սահմանումները և հապավումները՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div class=\"mb-0\">\r\n<p>6.1. &laquo;Կայք&raquo;՝ thehouse.am,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.2. &laquo;Ընկերություն&raquo; ՝ &laquo;Դը Հաուս&raquo; ՍՊԸ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.3. &laquo;Հաճախորդ&raquo; ՝ Կայք մուտք գործած և/կամ Կայքից որևէ ձևով օգտվող ցանկացած ֆիզիկական անձ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.4. &laquo;Պայմաններ&raquo; ՝ սույն Ընդհանուր դրույթները և պայմանները։</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Ընկերություն և հաճախորդ հարաբերություններ</div>\r\n<div class=\"section_text\">\r\n<p>1.Հաճախորդը, մուտք գործելով Կայք և/կամ որևէ կերպ օգտվելով Կայքից, տալիս է իր համաձայնությունը սույն Պայմանների, Գաղտնիության քաղաքականության և Վերադարձի պայմանների բոլոր դրույթներին։</p>\r\n<p>2.Հաճախորդի կողմից սույն Պայմանների, Գաղտնիության քաղաքականության և/կամ Վերադարձի պայմանների դրույթների հետ անհամաձայնության դեպքում Ընկերությունը հորդորում է չօգտվել Կայքից և լքել այն։</p>\r\n<p>3.Կայքի հասանելիությունը և օգտագործումը իրականացվում է Հաճախորդի սեփական ռիսկով։</p>\r\n<p>4.Կայք մուտք գործելիս Հաճախորդը պետք է հաստատի, որ հասել է ալկոհոլի օգտագործման համար ՀՀ օրենսդրությամբ սահմանված տարիքին։ Եթե Կայք մուտք գործած անձի տարիքը չի համապատասխանում ՀՀ օրենսդրությամբ սահմանված տարիքին, ապա Ընկերությունը հորդորում է լքել Կայքը։ Ընկերությունը որևէ պատասխանատվություն չի կրում նման տարիքի չհասած անձանց կողմից Կայք մուտք գործելու, իր տարիքի վերաբերյալ կեղծ տեղեկություններ հայտնելու հետևանքով առաջացած վնասների համար։</p>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Հաճախորդի վարքագիծը կայքից օգտվելիս</div>\r\n<div class=\"section_text\">\r\n<p>1. Ընկերությունը խրախուսում է վիրտուալ տիրույթում բարիդրացիական հարաբերությունների, միմյանց նկատմամբ հարգալից վերաբերմունքի մշակույթի ձևավորումը։</p>\r\n<p class=\"m-0\">2. Կայքից օգտվելիս Հաճախորդը իրավունք չունի բեռնել, տեղադրել, փոխանցել, տարածել կամ այլ եղանակներով Կայքում հրապարակել նյութեր, որոնք՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>12.1. Ապօրինի են, զրպարտիչ, վիրավորական, սպառնացող, որևէ խտրականություն պարունակող, կոպիտ, անպարկեշտ, կեղծ, պարունակում են անհարգալից բառապաշար, ֆիզիկական և/կամ հոգեկան բռնություն կիրառելու կամ դրա սպառնալիքի գրավոր կամ գրաֆիկական նկարագրություններ և ակնարկ դրա մասին, ներխուժում են այլ անձի մասնավոր կյանք կամ քարոզում են ատելություն, ինչպես նաև ՀՀ Սահմանադրությամբ և օրենքներով արգելված այլ գործողությունների կատարման նկարագրություն, դրա սպառնալիք և այլն,</p>\r\n</div>\r\n<div>\r\n<p>12.2. Իրենց բնույթով և/կամ բովանդակությամբ ՀՀ քրեական օրենսգրքով պատժելի արարք են կամ դրա խրախուսման կոչեր են, և/կամ կարող են հանգեցնել ՀՀ օրենսդրությամբ նախատեսված վարչական կամ քաղաքացիական պատասխանատվության,</p>\r\n</div>\r\n<div>\r\n<p>12.3. Խանգարում կամ խոչընդոտում են այլ Հաճախորդներին օգտվել Կայքից, այդ թվում՝ եթե դրա վերաբերյալ Ընկերությունը ստացել է գրավոր կամ բանավոր բողոք,</p>\r\n</div>\r\n<div>\r\n<p>12.4. Պարունակում են կիբեր-անվտանգությունը խարխլող վիրուսներ և/կամ այլ վնասակար բաղադրիչներ, ցանկացած տեսակի գովազդ, ինչպես նաև կեղծ կամ մոլորեցնեող ցուցումներ փաստերի ծագման կամ հաստատման վերաբերյալ:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>3. Այս կապակցությամբ Ընկերությունը իրեն իրավունք է վերապահում ջնջել ցանկացած տիպի մեկնաբանություն, գրառում, չպատասխանել հարցումներին, բողոքներին և դիմումներին, որոնք իրենց մեջ պարունակում են սույն Պայմանների 12-րդ կետով սահմանված դեպքերից և որևէ մեկը։</p>\r\n<p>4. ՀՀ օրենսդրությամբ սահմանված դեպքերում Ընկերությունն իրեն իրավունք է վերապահում դիմել իրավապահ մարմիններին։</p>\r\n<p class=\"m-0\">5. Հաճախորդը նախազգուշացվում և համաձայնվում է, որ՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>15.1. Իր կողմից տրամադրված անձնական տվյալները վերաբերում են միմիայն իրեն․ Հաճախորդն իրավունք չունի իրեն անձնավորել մեկ այլ ֆիզիկական կամ իրավաբանական անձի հետ, և/կամ տրամադրել այդ անձանց հետ ունեցած կապերի, դրանց բնույթի և բովանդակության վերաբերյալ կեղծ տեղեկություններ,</p>\r\n</div>\r\n<div>\r\n<p>15.2. բեռնել, հրապարակել, տեղադրել, վերարտադրել, փոխանցել, տարածել կամ ցանկացած այլ եղանակով օգտագործել Կայքից ստացված տեղեկատվություն կամ այլ նյութեր, որևէ նպատակներով, բացառությամբ սույն Պայմանների 24-րդ կետով սահմանված դեպքերի,</p>\r\n</div>\r\n<div>\r\n<p>15.3. որևէ գործողությամբ փորձել ստանալ անօրինական մուտք այլ համակարգչային համակարգերի նկատմամբ Կայքի միջոցով:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>6. Արգելվում է Կայքը ենթարկել կիբեր-գրոհների կամ որևէ գործողությամբ խաթարել Կայքի կիբեր-անվտանգությունը: Արգելվում է Կայքն օգտագործել ոչ նպատակային կերպով՝ դիտավորությամբ տեղադրելով վիրուսներ և/կամ ցանկացած այլ տիպաբանության վնասաբեր ծրագրեր կամ տեխնոլոգիապես վտանգավոր բնույթի նյութեր։</p>\r\n<p>7. Արգելվում է ապօրինի մուտք գործել Կայք, Կայքի սերվեր, որտեղ տեղակայված է Կայքը, և/կամ ցանկացած այլ սերվեր, համակարգիչ և/կամ տվյալների բազա(ներ), որոնք որևէ կերպ կապված են Կայքի հետ։ Ընկերությունը պատասխանատվություն չի կրում կիբեր-գրոհներով, վիրուսներով և/կամ ցանկացած այլ տիպաբանության վնասաբեր ծրագրերով և/կամ տեխնոլոգիապես վտանգավոր բնույթի նյութերով պատճառված վնասի համար, որոնք կարող են վնասել որևէ համակարգչային սարքավորում, ծրագրային ապահովում, տվյալներ, տվյալների բազա(ներ) կամ Կայքի օգտագործման հետևանքով Հաճախորդի կողմից որևէ նյութի բեռնման հետևանքով կամ դրանում նշված հղումով անցնելու դեպքում պատճառված վնասի համար։</p>\r\n</div>\r\n</div>', '<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Ներածություն</div>\r\n<div class=\"section_text\">\r\n<p>1.Սույն Ընդհանուր դրույթները և պայմանները &laquo;Դը Հաուս&raquo; ՍՊԸ կողմից մշակվել են հիմք ընդունելով ՀՀ քաղաքացիական օրենսգիրքը, &laquo;Առևտրի և ծառայությունների մասին&raquo; ՀՀ օրենքը, &laquo;Սպառողների իրավունքների պաշտպանությա մասին&raquo; ՀՀ օրենքը և այլ իրավական ակտեր։</p>\r\n<p>2.Սույն Ընդհանուր դրույթների և պայմանների նպատակն է կարգավորել &laquo;Դը Հաուս&raquo; ՍՊԸ և Հաճախորդների միջև առաջացող հարաբերություները՝ Կայք մուտք գործելիս և/կամ Կայքից որևէ ձևով օգտվելիս, ինչպես նաև, սակայն չսահմանափակվելով՝ Պատասխանատվության, Մտավոր սեփականության հետ առնչվող հարցերը։</p>\r\n<p>3.Սույն Ընդհանուր դրույթներն ու պայմանների անբաժանելի մասն են հանդիսանում Գաղտնիության քաղաքականությունը և Վերադարձի պայմանները։</p>\r\n<p>4.Հաճախորդների հետ կապված տեղեկատվությունը &laquo;Դը Հաուս&raquo; ՍՊԸ կողմից մշակվում է Գաղտնիության քաղաքականության համաձայն։</p>\r\n<p>5.Հաճախորդների հետ հարաբերությունները գնված ապրանքի ետ վերադարձման կամ փոխանակման կապացությամբ կարգավորվում են Վերադարձի պայմաններով։</p>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle m-b-16\">Սահմանումներ և հապավումներ</div>\r\n<div class=\"section_text\">\r\n<p class=\"m-0\">1. Սույն Ընդհանուր դրույթների և պայմանների իմաստով օգտագործվում են հետևյալ սահմանումները և հապավումները՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div class=\"mb-0\">\r\n<p>6.1. &laquo;Կայք&raquo;՝ thehouse.am,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.2. &laquo;Ընկերություն&raquo; ՝ &laquo;Դը Հաուս&raquo; ՍՊԸ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.3. &laquo;Հաճախորդ&raquo; ՝ Կայք մուտք գործած և/կամ Կայքից որևէ ձևով օգտվող ցանկացած ֆիզիկական անձ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>6.4. &laquo;Պայմաններ&raquo; ՝ սույն Ընդհանուր դրույթները և պայմանները։</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Ընկերություն և հաճախորդ հարաբերություններ</div>\r\n<div class=\"section_text\">\r\n<p>1.Հաճախորդը, մուտք գործելով Կայք և/կամ որևէ կերպ օգտվելով Կայքից, տալիս է իր համաձայնությունը սույն Պայմանների, Գաղտնիության քաղաքականության և Վերադարձի պայմանների բոլոր դրույթներին։</p>\r\n<p>2.Հաճախորդի կողմից սույն Պայմանների, Գաղտնիության քաղաքականության և/կամ Վերադարձի պայմանների դրույթների հետ անհամաձայնության դեպքում Ընկերությունը հորդորում է չօգտվել Կայքից և լքել այն։</p>\r\n<p>3.Կայքի հասանելիությունը և օգտագործումը իրականացվում է Հաճախորդի սեփական ռիսկով։</p>\r\n<p>4.Կայք մուտք գործելիս Հաճախորդը պետք է հաստատի, որ հասել է ալկոհոլի օգտագործման համար ՀՀ օրենսդրությամբ սահմանված տարիքին։ Եթե Կայք մուտք գործած անձի տարիքը չի համապատասխանում ՀՀ օրենսդրությամբ սահմանված տարիքին, ապա Ընկերությունը հորդորում է լքել Կայքը։ Ընկերությունը որևէ պատասխանատվություն չի կրում նման տարիքի չհասած անձանց կողմից Կայք մուտք գործելու, իր տարիքի վերաբերյալ կեղծ տեղեկություններ հայտնելու հետևանքով առաջացած վնասների համար։</p>\r\n</div>\r\n</div>\r\n<div class=\"section m-t-40\">\r\n<div class=\"m-b-16 section_subtitle\">Հաճախորդի վարքագիծը կայքից օգտվելիս</div>\r\n<div class=\"section_text\">\r\n<p>1. Ընկերությունը խրախուսում է վիրտուալ տիրույթում բարիդրացիական հարաբերությունների, միմյանց նկատմամբ հարգալից վերաբերմունքի մշակույթի ձևավորումը։</p>\r\n<p class=\"m-0\">2. Կայքից օգտվելիս Հաճախորդը իրավունք չունի բեռնել, տեղադրել, փոխանցել, տարածել կամ այլ եղանակներով Կայքում հրապարակել նյութեր, որոնք՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>12.1. Ապօրինի են, զրպարտիչ, վիրավորական, սպառնացող, որևէ խտրականություն պարունակող, կոպիտ, անպարկեշտ, կեղծ, պարունակում են անհարգալից բառապաշար, ֆիզիկական և/կամ հոգեկան բռնություն կիրառելու կամ դրա սպառնալիքի գրավոր կամ գրաֆիկական նկարագրություններ և ակնարկ դրա մասին, ներխուժում են այլ անձի մասնավոր կյանք կամ քարոզում են ատելություն, ինչպես նաև ՀՀ Սահմանադրությամբ և օրենքներով արգելված այլ գործողությունների կատարման նկարագրություն, դրա սպառնալիք և այլն,</p>\r\n</div>\r\n<div>\r\n<p>12.2. Իրենց բնույթով և/կամ բովանդակությամբ ՀՀ քրեական օրենսգրքով պատժելի արարք են կամ դրա խրախուսման կոչեր են, և/կամ կարող են հանգեցնել ՀՀ օրենսդրությամբ նախատեսված վարչական կամ քաղաքացիական պատասխանատվության,</p>\r\n</div>\r\n<div>\r\n<p>12.3. Խանգարում կամ խոչընդոտում են այլ Հաճախորդներին օգտվել Կայքից, այդ թվում՝ եթե դրա վերաբերյալ Ընկերությունը ստացել է գրավոր կամ բանավոր բողոք,</p>\r\n</div>\r\n<div>\r\n<p>12.4. Պարունակում են կիբեր-անվտանգությունը խարխլող վիրուսներ և/կամ այլ վնասակար բաղադրիչներ, ցանկացած տեսակի գովազդ, ինչպես նաև կեղծ կամ մոլորեցնեող ցուցումներ փաստերի ծագման կամ հաստատման վերաբերյալ:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>3. Այս կապակցությամբ Ընկերությունը իրեն իրավունք է վերապահում ջնջել ցանկացած տիպի մեկնաբանություն, գրառում, չպատասխանել հարցումներին, բողոքներին և դիմումներին, որոնք իրենց մեջ պարունակում են սույն Պայմանների 12-րդ կետով սահմանված դեպքերից և որևէ մեկը։</p>\r\n<p>4. ՀՀ օրենսդրությամբ սահմանված դեպքերում Ընկերությունն իրեն իրավունք է վերապահում դիմել իրավապահ մարմիններին։</p>\r\n<p class=\"m-0\">5. Հաճախորդը նախազգուշացվում և համաձայնվում է, որ՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>15.1. Իր կողմից տրամադրված անձնական տվյալները վերաբերում են միմիայն իրեն․ Հաճախորդն իրավունք չունի իրեն անձնավորել մեկ այլ ֆիզիկական կամ իրավաբանական անձի հետ, և/կամ տրամադրել այդ անձանց հետ ունեցած կապերի, դրանց բնույթի և բովանդակության վերաբերյալ կեղծ տեղեկություններ,</p>\r\n</div>\r\n<div>\r\n<p>15.2. բեռնել, հրապարակել, տեղադրել, վերարտադրել, փոխանցել, տարածել կամ ցանկացած այլ եղանակով օգտագործել Կայքից ստացված տեղեկատվություն կամ այլ նյութեր, որևէ նպատակներով, բացառությամբ սույն Պայմանների 24-րդ կետով սահմանված դեպքերի,</p>\r\n</div>\r\n<div>\r\n<p>15.3. որևէ գործողությամբ փորձել ստանալ անօրինական մուտք այլ համակարգչային համակարգերի նկատմամբ Կայքի միջոցով:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>6. Արգելվում է Կայքը ենթարկել կիբեր-գրոհների կամ որևէ գործողությամբ խաթարել Կայքի կիբեր-անվտանգությունը: Արգելվում է Կայքն օգտագործել ոչ նպատակային կերպով՝ դիտավորությամբ տեղադրելով վիրուսներ և/կամ ցանկացած այլ տիպաբանության վնասաբեր ծրագրեր կամ տեխնոլոգիապես վտանգավոր բնույթի նյութեր։</p>\r\n<p>7. Արգելվում է ապօրինի մուտք գործել Կայք, Կայքի սերվեր, որտեղ տեղակայված է Կայքը, և/կամ ցանկացած այլ սերվեր, համակարգիչ և/կամ տվյալների բազա(ներ), որոնք որևէ կերպ կապված են Կայքի հետ։ Ընկերությունը պատասխանատվություն չի կրում կիբեր-գրոհներով, վիրուսներով և/կամ ցանկացած այլ տիպաբանության վնասաբեր ծրագրերով և/կամ տեխնոլոգիապես վտանգավոր բնույթի նյութերով պատճառված վնասի համար, որոնք կարող են վնասել որևէ համակարգչային սարքավորում, ծրագրային ապահովում, տվյալներ, տվյալների բազա(ներ) կամ Կայքի օգտագործման հետևանքով Հաճախորդի կողմից որևէ նյութի բեռնման հետևանքով կամ դրանում նշված հղումով անցնելու դեպքում պատճառված վնասի համար։</p>\r\n</div>\r\n</div>', '2023-07-18 20:31:55', NULL);
INSERT INTO `articles` VALUES (3, 'Գաղտնիության քաղաքականություն', 'Գաղտնիության քաղաքականություն', 'Գաղտնիության քաղաքականություն', 'privacy-policy', '<div class=\"info m-b-40\">Ձգտելով պաշտպանել ՀՀ Սահմանադրությամբ, &laquo;Անձնական տվյալների պաշտպանության մասին&raquo; ՀՀ օրենքով և այլ իրավական ակտերով պաշտպանվող իր Հաճախորդներին անձնական տվյալները՝ &laquo;Դը Հաուս&raquo; ՍՊԸ-ն (գտնվելու վայր՝ ՀՀ, ք․Երևան, Ա․Սարգսյան 4) ընդունել է սույն &laquo;Գաղտնիության քաղաքականությունը&raquo;։ Այն սահմանում է &laquo;Դը Հաուս&raquo; ՍՊԸ-ի կողմից Հաճախորդի՝ thehouse.am կայք մուտք գործելիս վերջինիս տվյալների հավաքագրման, օգտագործման և պաշտպանության վերաբերյալ դրույթները։</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Սահմանումներ և հապավումներ</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">1. Սույն Գաղտնիության քաղաքականության իմաստով օգտագործվում են հետևյալ սահմանումները և հապավումները՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div class=\"mb-0\">\r\n<p>1.1. &laquo;Կայք&raquo;՝ thehouse.am,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.2. &laquo;Ընկերություն&raquo; ՝ &laquo;Դը Հաուս&raquo; ՍՊԸ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.3. &laquo;Հաճախորդ&raquo; ՝ Կայք մուտք գործած ցանկացած ֆիզիկական անձ, որը իր կողմից իրականացրած որոշ գործողությունների արդյունքում հնարավորություն է տալիս Ընկերությանը հավաքագրել իր անձնական տվյալները,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.4. &laquo;Տվյալներ&raquo;, &laquo;Անձնական տվյալներ&raquo; ՝ Հաճախորդին վերաբերող ցանկացած տեղեկություն, որը թույլ է տալիս կամ կարող է թույլ տալ ուղղակի կամ անուղղակի կերպով նույնականացնել նրա ինքնությունը, ներառյալ՝ նրա անունը, հասցեն, հեռախոսահամարը, տարիքը, սեռը, էլեկտրոնային հասցեն, ինչպես նաև Հաճախորդի անձին վերաբերող այլ տվյալներ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.5. &laquo;Ոչ անձնական տվյալներ&raquo; ՝ Հաճախորդների վերաբերյալ ընդհանուր վիճակագրությունը, Կայքի օգտագործման մասին տեղեկությունները և այլ ոչ անձնական տվյալները,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.6. &laquo;Քաղաքականություն&raquo; ՝ սույն Գաղտնիության քաղաքականությունը։</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Տվյալների հավաքագրումն ու օգտագործումը</div>\r\n<div class=\"section_text\">\r\n<p>1. Հաճախորդը, մուտք գործելով Կայք, ստանում է ծանուցում իր Անձնական տվյալների լրացման համաձայնություն տրամադրելու վերաբերյալ։ Այդ համաձայնությունը Հաճախորդը տալիս է համապատասխան հարցման վանդակում՝ &laquo;V&raquo; նշանը դնելու միջոցով։</p>\r\n<p>2. Հաճախորդը կարող է օգտվել Ընկերության Կայքից առանց իր մասին Անձնական տվյալներ տրամադրելու, սակայն դա կարող է սահմանափակել Կայքի որոշակի առանձնահատկություններից օգտվելու իր հնարավորությունը:</p>\r\n<p>3. Հաճախորդի կողմից տրամադրված տեղեկատվությունը ստացվում է Կայքում Ձևաթուղթը լրացնելով և գրանցվելով: Այդ տեղեկատվությունն է՝ Կայքն օգտագործելու համար գրանցման ժամանակ տրամադրված տեղեկատվությունը, Ընկերության ծառայություններին բաժանորդագրությունը, ներառյալ՝ նորություններին, տեղեկատվության հարցումներին, էլեկտրոնային նամակներով տրամադրված տեղեկատվությունը, մեկնաբանություններում թողած տեղեկությունները և այլն: Ընկերությունը նաև կարող է Հաճախորդից տեղեկատվության հարցում կատարել այն դեպքում, եթե Հաճախորդը հայտնում է Կայքում առկա խնդիրների մասին, նամակ ուղարկելիս Ընկերությունը կարող է պահպանել թղթակցությունը:</p>\r\n<p>4. Գրանցվելով Կայքում՝ Հաճախորդի կողմից լրացվում են Ձևաթղթում աստղանիշերով նշված դաշտերը, որոնք պատրադիր են լրացման։ Աստղանիշերով նշված դաշտերը չլրացնելու դեպքում հնարավոր չի լինի Կայքում գրանցվել։</p>\r\n<p>5. Կայք մտնելիս Հաճախորդի համակարգչի բրաուզերը Ընկերությանն է փոխանցում այնպիսի տեղեկություններ, ինչպիսիք են Հաճախորդի IP հասցեն, բրաուզերի տեսակը, այցելության ժամանակը, հարցման URL աղբյուրը. այդ տեղեկատվությունը հավաքվում և օգտագործվում է Կայքի այցելությունների մասին վիճակագրական տվյալների կազմման համար: Այդ տեղեկատվությունը կարող է օգտագործվել Կայքի և Ընկերության կողմից առաջարկվող ծառայությունների բարելավման համար:</p>\r\n<p>6. Հաճախորդի Անձնական տվյալները հավաքագրվում և օգտագործվում են միայն համաձայն ՀՀ օրենսդրության և սույն Քաղաքականության: Ընկերությունը Հաճախորդի Անձնական տվյալներ որևէ կերպ չի տրամադրում երրորդ անձանց և չի հրապարակում դրանք որևէ նպատակով՝ բացառությամբ ՀՀ օրենսդրությամբ սահմանված դեպքերի և/կամ Հաճախորդի համաձայնության դեպքում:</p>\r\n<p class=\"with_menu m-b-17\">7. Հաճախորդի Անձնական տվյալները Ընկերության կողմից հավաքագրվում և պահպանվում են հետևյալ դեպքերում (առանց սահմանափակման).</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Կայքում գրանցվելիս,</p>\r\n</div>\r\n<div>\r\n<p>բ) Բաժանորդագրվելիս,</p>\r\n</div>\r\n<div>\r\n<p>գ) Հատուկ առաջարկի մասնակցելիս,</p>\r\n</div>\r\n<div>\r\n<p>դ) Ցանկացած այլ հաղորդակցության ժամանակ:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">8. Ընկերությունը հավաքագրում է Հաճախորդի Անձնական տվյալները հետևյալ նպատակներով (առանց սահմանափակման)`</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Հաստատելու Հաճախորդի ինքնությունը,</p>\r\n</div>\r\n<div>\r\n<p>բ) Կայքում գնումներ իրականացնելու,</p>\r\n</div>\r\n<div>\r\n<p>գ) Պատասխանելու Հաճախորդի հարցերին և դիմումներին,</p>\r\n</div>\r\n<div>\r\n<p>դ) Հաճախորդի համար ապահովելու Կայքի որոշակի մասերի և առանձնահատկությունների հասանելիությունը,</p>\r\n</div>\r\n<div>\r\n<p>ե) Հաղորդակցվելու Հաճախորդի հետ՝ նրա հաշվի, ներկայացված հարցերի, խնդրանքների, առաջարկությունների, հետաքրքությունների, նախասիրությունների վերաբերյալ,</p>\r\n</div>\r\n<div>\r\n<p>զ) Նորություններին բաժանորդագրության, Միջոցառումների վերաբերյալ ծանուցման համար,</p>\r\n</div>\r\n<div>\r\n<p>է) Ընկերության ծառայությունների փոփոխությունների մասին Հաճախորդին ծանուցելու համար։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>9. Անձնական տվյալները Ընկերության կողմից պահպանվում են անորոշ ժամկետով։</p>\r\n<p>10. Ավտոմատ կերպով հավաքագրած տվյալները ներառում են միայն Կայքի լեզվի մասին տեղեկությունը։</p>\r\n<p>11. Ընկերությունը չունի հասանելիություն դեպի Հաճախորդի վճարային քարտերին կամ բանկային այլ տվյալներին, հետևաբար Ընկերությունը որևէ կերպ չի կարող գրանցել, հավաքագրել այդ տվյալները և որևէ կերպ չի կարող պատասխանատվություն կրել այդ տվյալների որևէ օգտագործման հետևանքով Հաճախորդի կրած վնասների համար (ներառյալ՝ առանց սահմանափակման, երրորդ անձանց կողմից այդ տվյալներին որևէ կերպ հասանելիություն ստանալու և որևէ գործողություն կատարելու դեպքերի):</p>\r\n</div>\r\n</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Տվյալներ ստացողները</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">1. Հաճախորդի տվյալները ստացողներն են՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Ընկերության կառուցվածքային ստորաբաժանումները,</p>\r\n</div>\r\n<div>\r\n<p>բ) ընկերություններ, որոնք կարող են օգնել Ընկերությանը Կայքի կառավարման և/կամ շահագործման գործում,</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>2. Սույն Քաղաքականությանը համաձայնություն տալով Հաճախորդը տալիս է իր համաձայնությունը, որպեսզի Ընկերությունը սույն Քաղաքականության շրջանակներում և նպատակներով իր Անձնական տվյալները տրամադրի սույն Քաղաքականության 13-րդ կետի &laquo;բ&raquo; ենթակետում նշված Կայքի կառավարման և/կամ շահագործման գործում Ընկերության օժանդակող ընկերություններին։</p>\r\n<p class=\"with_menu m-b-17\">3. Ընկերությունը նաև կարող է Հաճախորդի տվյալները տրամադրել երրորդ անձանց հետևյալ դեպքերում՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) եթե Հաճախորդը այդ տեղեկատվության բացահայտման նախնական համաձայանություն է տվել,</p>\r\n</div>\r\n<div>\r\n<p>բ) եթե պետք է բացահայտել տվյալները Հաճախորդի կողմից հարցվող ապրանքի կամ ծառայության տրամադրման համար,</p>\r\n</div>\r\n<div>\r\n<p>գ) եթե Ընկերությունը պարտավոր է հայտնել Հաճախորդի տվյալները՝ ՀՀ օրենսդրությամբ սահմանված դեպքերում և կարգով:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>4. Սույն Քաղաքականության 15-րդ կետի &laquo;ա&raquo; ենթակետով սահմանված համաձայնությունը Հաճախորդը տրամադրում է էլեկտրոնային նամակով՝ Ընկերության կողմից ուղարկված հարցմանը համաձայն։ Ընկերությունը հարցման մեջ նշում է այն հանգամանքները, որոնք առիթ են հանդիսացել Անձնական տվյալների՝ երրորդ անձանց փոխանցման համար, և որոնք Ընկերությունը կարող է տրամադրել միայն Հաճախորդի կողմից նախնական համաձայնությունը ստանալուց հետո։ Սույն կետով սահմանված համաձայնությունն անհրաժեշտ չէ, եթե Ընկերությունը երրորդ անձանց է տրամադրում Անձնական տվայլները՝ 15-րդ կետի &laquo;գ&raquo; ենթակետով սահմանված դեպքերում։</p>\r\n</div>\r\n</div>', '<div class=\"info m-b-40\">Ձգտելով պաշտպանել ՀՀ Սահմանադրությամբ, &laquo;Անձնական տվյալների պաշտպանության մասին&raquo; ՀՀ օրենքով և այլ իրավական ակտերով պաշտպանվող իր Հաճախորդներին անձնական տվյալները՝ &laquo;Դը Հաուս&raquo; ՍՊԸ-ն (գտնվելու վայր՝ ՀՀ, ք․Երևան, Ա․Սարգսյան 4) ընդունել է սույն &laquo;Գաղտնիության քաղաքականությունը&raquo;։ Այն սահմանում է &laquo;Դը Հաուս&raquo; ՍՊԸ-ի կողմից Հաճախորդի՝ thehouse.am կայք մուտք գործելիս վերջինիս տվյալների հավաքագրման, օգտագործման և պաշտպանության վերաբերյալ դրույթները։</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Սահմանումներ և հապավումներ</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">1. Սույն Գաղտնիության քաղաքականության իմաստով օգտագործվում են հետևյալ սահմանումները և հապավումները՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div class=\"mb-0\">\r\n<p>1.1. &laquo;Կայք&raquo;՝ thehouse.am,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.2. &laquo;Ընկերություն&raquo; ՝ &laquo;Դը Հաուս&raquo; ՍՊԸ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.3. &laquo;Հաճախորդ&raquo; ՝ Կայք մուտք գործած ցանկացած ֆիզիկական անձ, որը իր կողմից իրականացրած որոշ գործողությունների արդյունքում հնարավորություն է տալիս Ընկերությանը հավաքագրել իր անձնական տվյալները,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.4. &laquo;Տվյալներ&raquo;, &laquo;Անձնական տվյալներ&raquo; ՝ Հաճախորդին վերաբերող ցանկացած տեղեկություն, որը թույլ է տալիս կամ կարող է թույլ տալ ուղղակի կամ անուղղակի կերպով նույնականացնել նրա ինքնությունը, ներառյալ՝ նրա անունը, հասցեն, հեռախոսահամարը, տարիքը, սեռը, էլեկտրոնային հասցեն, ինչպես նաև Հաճախորդի անձին վերաբերող այլ տվյալներ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.5. &laquo;Ոչ անձնական տվյալներ&raquo; ՝ Հաճախորդների վերաբերյալ ընդհանուր վիճակագրությունը, Կայքի օգտագործման մասին տեղեկությունները և այլ ոչ անձնական տվյալները,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.6. &laquo;Քաղաքականություն&raquo; ՝ սույն Գաղտնիության քաղաքականությունը։</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Տվյալների հավաքագրումն ու օգտագործումը</div>\r\n<div class=\"section_text\">\r\n<p>1. Հաճախորդը, մուտք գործելով Կայք, ստանում է ծանուցում իր Անձնական տվյալների լրացման համաձայնություն տրամադրելու վերաբերյալ։ Այդ համաձայնությունը Հաճախորդը տալիս է համապատասխան հարցման վանդակում՝ &laquo;V&raquo; նշանը դնելու միջոցով։</p>\r\n<p>2. Հաճախորդը կարող է օգտվել Ընկերության Կայքից առանց իր մասին Անձնական տվյալներ տրամադրելու, սակայն դա կարող է սահմանափակել Կայքի որոշակի առանձնահատկություններից օգտվելու իր հնարավորությունը:</p>\r\n<p>3. Հաճախորդի կողմից տրամադրված տեղեկատվությունը ստացվում է Կայքում Ձևաթուղթը լրացնելով և գրանցվելով: Այդ տեղեկատվությունն է՝ Կայքն օգտագործելու համար գրանցման ժամանակ տրամադրված տեղեկատվությունը, Ընկերության ծառայություններին բաժանորդագրությունը, ներառյալ՝ նորություններին, տեղեկատվության հարցումներին, էլեկտրոնային նամակներով տրամադրված տեղեկատվությունը, մեկնաբանություններում թողած տեղեկությունները և այլն: Ընկերությունը նաև կարող է Հաճախորդից տեղեկատվության հարցում կատարել այն դեպքում, եթե Հաճախորդը հայտնում է Կայքում առկա խնդիրների մասին, նամակ ուղարկելիս Ընկերությունը կարող է պահպանել թղթակցությունը:</p>\r\n<p>4. Գրանցվելով Կայքում՝ Հաճախորդի կողմից լրացվում են Ձևաթղթում աստղանիշերով նշված դաշտերը, որոնք պատրադիր են լրացման։ Աստղանիշերով նշված դաշտերը չլրացնելու դեպքում հնարավոր չի լինի Կայքում գրանցվել։</p>\r\n<p>5. Կայք մտնելիս Հաճախորդի համակարգչի բրաուզերը Ընկերությանն է փոխանցում այնպիսի տեղեկություններ, ինչպիսիք են Հաճախորդի IP հասցեն, բրաուզերի տեսակը, այցելության ժամանակը, հարցման URL աղբյուրը. այդ տեղեկատվությունը հավաքվում և օգտագործվում է Կայքի այցելությունների մասին վիճակագրական տվյալների կազմման համար: Այդ տեղեկատվությունը կարող է օգտագործվել Կայքի և Ընկերության կողմից առաջարկվող ծառայությունների բարելավման համար:</p>\r\n<p>6. Հաճախորդի Անձնական տվյալները հավաքագրվում և օգտագործվում են միայն համաձայն ՀՀ օրենսդրության և սույն Քաղաքականության: Ընկերությունը Հաճախորդի Անձնական տվյալներ որևէ կերպ չի տրամադրում երրորդ անձանց և չի հրապարակում դրանք որևէ նպատակով՝ բացառությամբ ՀՀ օրենսդրությամբ սահմանված դեպքերի և/կամ Հաճախորդի համաձայնության դեպքում:</p>\r\n<p class=\"with_menu m-b-17\">7. Հաճախորդի Անձնական տվյալները Ընկերության կողմից հավաքագրվում և պահպանվում են հետևյալ դեպքերում (առանց սահմանափակման).</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Կայքում գրանցվելիս,</p>\r\n</div>\r\n<div>\r\n<p>բ) Բաժանորդագրվելիս,</p>\r\n</div>\r\n<div>\r\n<p>գ) Հատուկ առաջարկի մասնակցելիս,</p>\r\n</div>\r\n<div>\r\n<p>դ) Ցանկացած այլ հաղորդակցության ժամանակ:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">8. Ընկերությունը հավաքագրում է Հաճախորդի Անձնական տվյալները հետևյալ նպատակներով (առանց սահմանափակման)`</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Հաստատելու Հաճախորդի ինքնությունը,</p>\r\n</div>\r\n<div>\r\n<p>բ) Կայքում գնումներ իրականացնելու,</p>\r\n</div>\r\n<div>\r\n<p>գ) Պատասխանելու Հաճախորդի հարցերին և դիմումներին,</p>\r\n</div>\r\n<div>\r\n<p>դ) Հաճախորդի համար ապահովելու Կայքի որոշակի մասերի և առանձնահատկությունների հասանելիությունը,</p>\r\n</div>\r\n<div>\r\n<p>ե) Հաղորդակցվելու Հաճախորդի հետ՝ նրա հաշվի, ներկայացված հարցերի, խնդրանքների, առաջարկությունների, հետաքրքությունների, նախասիրությունների վերաբերյալ,</p>\r\n</div>\r\n<div>\r\n<p>զ) Նորություններին բաժանորդագրության, Միջոցառումների վերաբերյալ ծանուցման համար,</p>\r\n</div>\r\n<div>\r\n<p>է) Ընկերության ծառայությունների փոփոխությունների մասին Հաճախորդին ծանուցելու համար։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>9. Անձնական տվյալները Ընկերության կողմից պահպանվում են անորոշ ժամկետով։</p>\r\n<p>10. Ավտոմատ կերպով հավաքագրած տվյալները ներառում են միայն Կայքի լեզվի մասին տեղեկությունը։</p>\r\n<p>11. Ընկերությունը չունի հասանելիություն դեպի Հաճախորդի վճարային քարտերին կամ բանկային այլ տվյալներին, հետևաբար Ընկերությունը որևէ կերպ չի կարող գրանցել, հավաքագրել այդ տվյալները և որևէ կերպ չի կարող պատասխանատվություն կրել այդ տվյալների որևէ օգտագործման հետևանքով Հաճախորդի կրած վնասների համար (ներառյալ՝ առանց սահմանափակման, երրորդ անձանց կողմից այդ տվյալներին որևէ կերպ հասանելիություն ստանալու և որևէ գործողություն կատարելու դեպքերի):</p>\r\n</div>\r\n</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Տվյալներ ստացողները</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">1. Հաճախորդի տվյալները ստացողներն են՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Ընկերության կառուցվածքային ստորաբաժանումները,</p>\r\n</div>\r\n<div>\r\n<p>բ) ընկերություններ, որոնք կարող են օգնել Ընկերությանը Կայքի կառավարման և/կամ շահագործման գործում,</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>2. Սույն Քաղաքականությանը համաձայնություն տալով Հաճախորդը տալիս է իր համաձայնությունը, որպեսզի Ընկերությունը սույն Քաղաքականության շրջանակներում և նպատակներով իր Անձնական տվյալները տրամադրի սույն Քաղաքականության 13-րդ կետի &laquo;բ&raquo; ենթակետում նշված Կայքի կառավարման և/կամ շահագործման գործում Ընկերության օժանդակող ընկերություններին։</p>\r\n<p class=\"with_menu m-b-17\">3. Ընկերությունը նաև կարող է Հաճախորդի տվյալները տրամադրել երրորդ անձանց հետևյալ դեպքերում՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) եթե Հաճախորդը այդ տեղեկատվության բացահայտման նախնական համաձայանություն է տվել,</p>\r\n</div>\r\n<div>\r\n<p>բ) եթե պետք է բացահայտել տվյալները Հաճախորդի կողմից հարցվող ապրանքի կամ ծառայության տրամադրման համար,</p>\r\n</div>\r\n<div>\r\n<p>գ) եթե Ընկերությունը պարտավոր է հայտնել Հաճախորդի տվյալները՝ ՀՀ օրենսդրությամբ սահմանված դեպքերում և կարգով:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>4. Սույն Քաղաքականության 15-րդ կետի &laquo;ա&raquo; ենթակետով սահմանված համաձայնությունը Հաճախորդը տրամադրում է էլեկտրոնային նամակով՝ Ընկերության կողմից ուղարկված հարցմանը համաձայն։ Ընկերությունը հարցման մեջ նշում է այն հանգամանքները, որոնք առիթ են հանդիսացել Անձնական տվյալների՝ երրորդ անձանց փոխանցման համար, և որոնք Ընկերությունը կարող է տրամադրել միայն Հաճախորդի կողմից նախնական համաձայնությունը ստանալուց հետո։ Սույն կետով սահմանված համաձայնությունն անհրաժեշտ չէ, եթե Ընկերությունը երրորդ անձանց է տրամադրում Անձնական տվայլները՝ 15-րդ կետի &laquo;գ&raquo; ենթակետով սահմանված դեպքերում։</p>\r\n</div>\r\n</div>', '<div class=\"info m-b-40\">Ձգտելով պաշտպանել ՀՀ Սահմանադրությամբ, &laquo;Անձնական տվյալների պաշտպանության մասին&raquo; ՀՀ օրենքով և այլ իրավական ակտերով պաշտպանվող իր Հաճախորդներին անձնական տվյալները՝ &laquo;Դը Հաուս&raquo; ՍՊԸ-ն (գտնվելու վայր՝ ՀՀ, ք․Երևան, Ա․Սարգսյան 4) ընդունել է սույն &laquo;Գաղտնիության քաղաքականությունը&raquo;։ Այն սահմանում է &laquo;Դը Հաուս&raquo; ՍՊԸ-ի կողմից Հաճախորդի՝ thehouse.am կայք մուտք գործելիս վերջինիս տվյալների հավաքագրման, օգտագործման և պաշտպանության վերաբերյալ դրույթները։</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Սահմանումներ և հապավումներ</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">1. Սույն Գաղտնիության քաղաքականության իմաստով օգտագործվում են հետևյալ սահմանումները և հապավումները՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div class=\"mb-0\">\r\n<p>1.1. &laquo;Կայք&raquo;՝ thehouse.am,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.2. &laquo;Ընկերություն&raquo; ՝ &laquo;Դը Հաուս&raquo; ՍՊԸ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.3. &laquo;Հաճախորդ&raquo; ՝ Կայք մուտք գործած ցանկացած ֆիզիկական անձ, որը իր կողմից իրականացրած որոշ գործողությունների արդյունքում հնարավորություն է տալիս Ընկերությանը հավաքագրել իր անձնական տվյալները,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.4. &laquo;Տվյալներ&raquo;, &laquo;Անձնական տվյալներ&raquo; ՝ Հաճախորդին վերաբերող ցանկացած տեղեկություն, որը թույլ է տալիս կամ կարող է թույլ տալ ուղղակի կամ անուղղակի կերպով նույնականացնել նրա ինքնությունը, ներառյալ՝ նրա անունը, հասցեն, հեռախոսահամարը, տարիքը, սեռը, էլեկտրոնային հասցեն, ինչպես նաև Հաճախորդի անձին վերաբերող այլ տվյալներ,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.5. &laquo;Ոչ անձնական տվյալներ&raquo; ՝ Հաճախորդների վերաբերյալ ընդհանուր վիճակագրությունը, Կայքի օգտագործման մասին տեղեկությունները և այլ ոչ անձնական տվյալները,</p>\r\n</div>\r\n<div class=\"mb-0\">\r\n<p>1.6. &laquo;Քաղաքականություն&raquo; ՝ սույն Գաղտնիության քաղաքականությունը։</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Տվյալների հավաքագրումն ու օգտագործումը</div>\r\n<div class=\"section_text\">\r\n<p>1. Հաճախորդը, մուտք գործելով Կայք, ստանում է ծանուցում իր Անձնական տվյալների լրացման համաձայնություն տրամադրելու վերաբերյալ։ Այդ համաձայնությունը Հաճախորդը տալիս է համապատասխան հարցման վանդակում՝ &laquo;V&raquo; նշանը դնելու միջոցով։</p>\r\n<p>2. Հաճախորդը կարող է օգտվել Ընկերության Կայքից առանց իր մասին Անձնական տվյալներ տրամադրելու, սակայն դա կարող է սահմանափակել Կայքի որոշակի առանձնահատկություններից օգտվելու իր հնարավորությունը:</p>\r\n<p>3. Հաճախորդի կողմից տրամադրված տեղեկատվությունը ստացվում է Կայքում Ձևաթուղթը լրացնելով և գրանցվելով: Այդ տեղեկատվությունն է՝ Կայքն օգտագործելու համար գրանցման ժամանակ տրամադրված տեղեկատվությունը, Ընկերության ծառայություններին բաժանորդագրությունը, ներառյալ՝ նորություններին, տեղեկատվության հարցումներին, էլեկտրոնային նամակներով տրամադրված տեղեկատվությունը, մեկնաբանություններում թողած տեղեկությունները և այլն: Ընկերությունը նաև կարող է Հաճախորդից տեղեկատվության հարցում կատարել այն դեպքում, եթե Հաճախորդը հայտնում է Կայքում առկա խնդիրների մասին, նամակ ուղարկելիս Ընկերությունը կարող է պահպանել թղթակցությունը:</p>\r\n<p>4. Գրանցվելով Կայքում՝ Հաճախորդի կողմից լրացվում են Ձևաթղթում աստղանիշերով նշված դաշտերը, որոնք պատրադիր են լրացման։ Աստղանիշերով նշված դաշտերը չլրացնելու դեպքում հնարավոր չի լինի Կայքում գրանցվել։</p>\r\n<p>5. Կայք մտնելիս Հաճախորդի համակարգչի բրաուզերը Ընկերությանն է փոխանցում այնպիսի տեղեկություններ, ինչպիսիք են Հաճախորդի IP հասցեն, բրաուզերի տեսակը, այցելության ժամանակը, հարցման URL աղբյուրը. այդ տեղեկատվությունը հավաքվում և օգտագործվում է Կայքի այցելությունների մասին վիճակագրական տվյալների կազմման համար: Այդ տեղեկատվությունը կարող է օգտագործվել Կայքի և Ընկերության կողմից առաջարկվող ծառայությունների բարելավման համար:</p>\r\n<p>6. Հաճախորդի Անձնական տվյալները հավաքագրվում և օգտագործվում են միայն համաձայն ՀՀ օրենսդրության և սույն Քաղաքականության: Ընկերությունը Հաճախորդի Անձնական տվյալներ որևէ կերպ չի տրամադրում երրորդ անձանց և չի հրապարակում դրանք որևէ նպատակով՝ բացառությամբ ՀՀ օրենսդրությամբ սահմանված դեպքերի և/կամ Հաճախորդի համաձայնության դեպքում:</p>\r\n<p class=\"with_menu m-b-17\">7. Հաճախորդի Անձնական տվյալները Ընկերության կողմից հավաքագրվում և պահպանվում են հետևյալ դեպքերում (առանց սահմանափակման).</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Կայքում գրանցվելիս,</p>\r\n</div>\r\n<div>\r\n<p>բ) Բաժանորդագրվելիս,</p>\r\n</div>\r\n<div>\r\n<p>գ) Հատուկ առաջարկի մասնակցելիս,</p>\r\n</div>\r\n<div>\r\n<p>դ) Ցանկացած այլ հաղորդակցության ժամանակ:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">8. Ընկերությունը հավաքագրում է Հաճախորդի Անձնական տվյալները հետևյալ նպատակներով (առանց սահմանափակման)`</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Հաստատելու Հաճախորդի ինքնությունը,</p>\r\n</div>\r\n<div>\r\n<p>բ) Կայքում գնումներ իրականացնելու,</p>\r\n</div>\r\n<div>\r\n<p>գ) Պատասխանելու Հաճախորդի հարցերին և դիմումներին,</p>\r\n</div>\r\n<div>\r\n<p>դ) Հաճախորդի համար ապահովելու Կայքի որոշակի մասերի և առանձնահատկությունների հասանելիությունը,</p>\r\n</div>\r\n<div>\r\n<p>ե) Հաղորդակցվելու Հաճախորդի հետ՝ նրա հաշվի, ներկայացված հարցերի, խնդրանքների, առաջարկությունների, հետաքրքությունների, նախասիրությունների վերաբերյալ,</p>\r\n</div>\r\n<div>\r\n<p>զ) Նորություններին բաժանորդագրության, Միջոցառումների վերաբերյալ ծանուցման համար,</p>\r\n</div>\r\n<div>\r\n<p>է) Ընկերության ծառայությունների փոփոխությունների մասին Հաճախորդին ծանուցելու համար։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>9. Անձնական տվյալները Ընկերության կողմից պահպանվում են անորոշ ժամկետով։</p>\r\n<p>10. Ավտոմատ կերպով հավաքագրած տվյալները ներառում են միայն Կայքի լեզվի մասին տեղեկությունը։</p>\r\n<p>11. Ընկերությունը չունի հասանելիություն դեպի Հաճախորդի վճարային քարտերին կամ բանկային այլ տվյալներին, հետևաբար Ընկերությունը որևէ կերպ չի կարող գրանցել, հավաքագրել այդ տվյալները և որևէ կերպ չի կարող պատասխանատվություն կրել այդ տվյալների որևէ օգտագործման հետևանքով Հաճախորդի կրած վնասների համար (ներառյալ՝ առանց սահմանափակման, երրորդ անձանց կողմից այդ տվյալներին որևէ կերպ հասանելիություն ստանալու և որևէ գործողություն կատարելու դեպքերի):</p>\r\n</div>\r\n</div>\r\n<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Տվյալներ ստացողները</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu m-b-17\">1. Հաճախորդի տվյալները ստացողներն են՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) Ընկերության կառուցվածքային ստորաբաժանումները,</p>\r\n</div>\r\n<div>\r\n<p>բ) ընկերություններ, որոնք կարող են օգնել Ընկերությանը Կայքի կառավարման և/կամ շահագործման գործում,</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>2. Սույն Քաղաքականությանը համաձայնություն տալով Հաճախորդը տալիս է իր համաձայնությունը, որպեսզի Ընկերությունը սույն Քաղաքականության շրջանակներում և նպատակներով իր Անձնական տվյալները տրամադրի սույն Քաղաքականության 13-րդ կետի &laquo;բ&raquo; ենթակետում նշված Կայքի կառավարման և/կամ շահագործման գործում Ընկերության օժանդակող ընկերություններին։</p>\r\n<p class=\"with_menu m-b-17\">3. Ընկերությունը նաև կարող է Հաճախորդի տվյալները տրամադրել երրորդ անձանց հետևյալ դեպքերում՝</p>\r\n</div>\r\n<div class=\"menu m-b-17\">\r\n<div>\r\n<p>ա) եթե Հաճախորդը այդ տեղեկատվության բացահայտման նախնական համաձայանություն է տվել,</p>\r\n</div>\r\n<div>\r\n<p>բ) եթե պետք է բացահայտել տվյալները Հաճախորդի կողմից հարցվող ապրանքի կամ ծառայության տրամադրման համար,</p>\r\n</div>\r\n<div>\r\n<p>գ) եթե Ընկերությունը պարտավոր է հայտնել Հաճախորդի տվյալները՝ ՀՀ օրենսդրությամբ սահմանված դեպքերում և կարգով:</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>4. Սույն Քաղաքականության 15-րդ կետի &laquo;ա&raquo; ենթակետով սահմանված համաձայնությունը Հաճախորդը տրամադրում է էլեկտրոնային նամակով՝ Ընկերության կողմից ուղարկված հարցմանը համաձայն։ Ընկերությունը հարցման մեջ նշում է այն հանգամանքները, որոնք առիթ են հանդիսացել Անձնական տվյալների՝ երրորդ անձանց փոխանցման համար, և որոնք Ընկերությունը կարող է տրամադրել միայն Հաճախորդի կողմից նախնական համաձայնությունը ստանալուց հետո։ Սույն կետով սահմանված համաձայնությունն անհրաժեշտ չէ, եթե Ընկերությունը երրորդ անձանց է տրամադրում Անձնական տվայլները՝ 15-րդ կետի &laquo;գ&raquo; ենթակետով սահմանված դեպքերում։</p>\r\n</div>\r\n</div>', NULL, NULL);
INSERT INTO `articles` VALUES (4, 'Վերադարձի պայմաններ', 'Վերադարձի պայմաններ', 'Վերադարձի պայմաններ', 'return-policy', '<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Սննդամթերքը (այդ թվում՝ ալկոհոլային արտադրանքը), համարվելով պարենային ապրանք, համաձայն ՀՀ քաղաքացիական օրենսգրքի 484, 491 և 518-րդ հոդվածների համապատասխան դրույթների, Հաճախորդի կողմից ենթակա է վերադարձման միայն ստորև նշված դեպքերում՝</div>\r\n<div class=\"menu return m-b-17\">\r\n<div>\r\n<p>ա) մինչև Հաճախորդի կողմից պատվերի ստացումը,</p>\r\n</div>\r\n<div>\r\n<p>բ) մինչև Հաճախորդի կողմից առաքման փաստաթղթի ստորագրումը,</p>\r\n</div>\r\n<div>\r\n<p>գ) եթե առաքումը ստանալուց հետո Հաճախորդը հայտնաբերել է, որ ապրանքը չի համապատասխանում իր պատվերին, ապրանքն անորակ է կամ վնասված։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu\">Հաճախորդի կողմից ապրանքի թերության հայտնաբերման դեպքում վերջինս իրավունք ունի պահանջելու՝</p>\r\n</div>\r\n<div class=\"menu return\">\r\n<div>\r\n<p>1. Փոխարինելու նման անորակ կամ վնասված ապրանքը պատշաճ որակի ապրանքով,</p>\r\n</div>\r\n<div>\r\n<p>2. Համաչափորեն իջեցնելու գինը,</p>\r\n</div>\r\n<div>\r\n<p>3. Վերադարձնելու ապրանքի համար վճարված գումարը։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>Մնացած բոլոր դեպքերում, համաձայն &laquo;Սպառողների իրավունքների պաշտպանության մասին&raquo; ՀՀ օրենքի 23-րդ հոդվածի, գնված և պատշաճ որակի ապրանքները չեն վերադարձվում։</p>\r\n<p>Գումարի վերադարձն իրականացվում է բանկային փոխանցմամբ՝ ողջամիտ ժամկետում։</p>\r\n</div>\r\n</div>', '<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Սննդամթերքը (այդ թվում՝ ալկոհոլային արտադրանքը), համարվելով պարենային ապրանք, համաձայն ՀՀ քաղաքացիական օրենսգրքի 484, 491 և 518-րդ հոդվածների համապատասխան դրույթների, Հաճախորդի կողմից ենթակա է վերադարձման միայն ստորև նշված դեպքերում՝</div>\r\n<div class=\"menu return m-b-17\">\r\n<div>\r\n<p>ա) մինչև Հաճախորդի կողմից պատվերի ստացումը,</p>\r\n</div>\r\n<div>\r\n<p>բ) մինչև Հաճախորդի կողմից առաքման փաստաթղթի ստորագրումը,</p>\r\n</div>\r\n<div>\r\n<p>գ) եթե առաքումը ստանալուց հետո Հաճախորդը հայտնաբերել է, որ ապրանքը չի համապատասխանում իր պատվերին, ապրանքն անորակ է կամ վնասված։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu\">Հաճախորդի կողմից ապրանքի թերության հայտնաբերման դեպքում վերջինս իրավունք ունի պահանջելու՝</p>\r\n</div>\r\n<div class=\"menu return\">\r\n<div>\r\n<p>1. Փոխարինելու նման անորակ կամ վնասված ապրանքը պատշաճ որակի ապրանքով,</p>\r\n</div>\r\n<div>\r\n<p>2. Համաչափորեն իջեցնելու գինը,</p>\r\n</div>\r\n<div>\r\n<p>3. Վերադարձնելու ապրանքի համար վճարված գումարը։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>Մնացած բոլոր դեպքերում, համաձայն &laquo;Սպառողների իրավունքների պաշտպանության մասին&raquo; ՀՀ օրենքի 23-րդ հոդվածի, գնված և պատշաճ որակի ապրանքները չեն վերադարձվում։</p>\r\n<p>Գումարի վերադարձն իրականացվում է բանկային փոխանցմամբ՝ ողջամիտ ժամկետում։</p>\r\n</div>\r\n</div>', '<div class=\"section\">\r\n<div class=\"m-b-16 section_subtitle\">Սննդամթերքը (այդ թվում՝ ալկոհոլային արտադրանքը), համարվելով պարենային ապրանք, համաձայն ՀՀ քաղաքացիական օրենսգրքի 484, 491 և 518-րդ հոդվածների համապատասխան դրույթների, Հաճախորդի կողմից ենթակա է վերադարձման միայն ստորև նշված դեպքերում՝</div>\r\n<div class=\"menu return m-b-17\">\r\n<div>\r\n<p>ա) մինչև Հաճախորդի կողմից պատվերի ստացումը,</p>\r\n</div>\r\n<div>\r\n<p>բ) մինչև Հաճախորդի կողմից առաքման փաստաթղթի ստորագրումը,</p>\r\n</div>\r\n<div>\r\n<p>գ) եթե առաքումը ստանալուց հետո Հաճախորդը հայտնաբերել է, որ ապրանքը չի համապատասխանում իր պատվերին, ապրանքն անորակ է կամ վնասված։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p class=\"with_menu\">Հաճախորդի կողմից ապրանքի թերության հայտնաբերման դեպքում վերջինս իրավունք ունի պահանջելու՝</p>\r\n</div>\r\n<div class=\"menu return\">\r\n<div>\r\n<p>1. Փոխարինելու նման անորակ կամ վնասված ապրանքը պատշաճ որակի ապրանքով,</p>\r\n</div>\r\n<div>\r\n<p>2. Համաչափորեն իջեցնելու գինը,</p>\r\n</div>\r\n<div>\r\n<p>3. Վերադարձնելու ապրանքի համար վճարված գումարը։</p>\r\n</div>\r\n</div>\r\n<div class=\"section_text\">\r\n<p>Մնացած բոլոր դեպքերում, համաձայն &laquo;Սպառողների իրավունքների պաշտպանության մասին&raquo; ՀՀ օրենքի 23-րդ հոդվածի, գնված և պատշաճ որակի ապրանքները չեն վերադարձվում։</p>\r\n<p>Գումարի վերադարձն իրականացվում է բանկային փոխանցմամբ՝ ողջամիտ ժամկետում։</p>\r\n</div>\r\n</div>', NULL, NULL);
